class Solution {
    func punishmentNumber(_ n: Int) -> Int {
        func isValid(_ num: Int, _ square: String) -> Bool {
            let s = String(num)
            var i = 0
            var sum = 0
            while i < square.count {
                sum = 0
                for j in i..<square.count {
                    let indexStart = square.index(square.startIndex, offsetBy: j)
                    let indexEnd = square.index(square.startIndex, offsetBy: j+1)
                    if let val = Int(square[indexStart..<indexEnd]) {
                        sum = sum * 10 + val
                        if sum == num {
                            return true
                        }
                        if sum > num || (j < square.count - 1 && square[square.index(after: indexStart)] == "0") {
                            break
                        }
                    }
                }
                i += 1
            }
            return false
        }

        var result = 0
        for i in 1...n {
            let square = i * i
            if isValid(i, String(square)) {
                result += square
            }
        }
        return result
    }
